import '../menu/menu.css'
export default function Menu() {
  return (
    <div className='menu'>
          <p>aurelien peria </p>
          <p>Réside à Sannois</p>
          <p><a id='liencontact'>Contact</a> <a id='lienprojet'>Projet</a></p>
      </div>
  )
}
